tables.table_schema:
CREATE TABLE genetic_sequences (
    sequence_id INT PRIMARY KEY,
    sequence_data TEXT,
    gene_name TEXT,
    sequence_length INT
);

CREATE TABLE genetic_sequences (
    id SERIAL PRIMARY KEY,
    sequence_data TEXT,
    sequence_length INT,
    organism_name TEXT
);

CREATE TABLE analysis_results (
    result_id SERIAL PRIMARY KEY,
    sequence_id INT,
    analysis_type TEXT,
    analysis_result TEXT
);

CREATE TABLE genetic_data (
    id INT PRIMARY KEY,
    dna_sequence TEXT,
    quality_score FLOAT
);

CREATE TABLE sample_information (
    sample_id INT PRIMARY KEY,
    patient_id INT,
    sample_location TEXT
);

CREATE TABLE analysis_results (
    result_id INT PRIMARY KEY,
    sample_id INT,
    analysis_date DATE,
    result_summary TEXT
);
